import React from "react";
import { useSelector } from "react-redux";
// import { Lines } from "./Lines";
import "../App.css";

export const DoneCommands = () => {
    const { commands } = useSelector(state => state);
    return (
        <div className="done-commands">
            {commands.map((command, index)=>{
            <span key={index}></span>
            })}
        </div>
    );
}
